import React from "react";
//import { NavLink, Link, useNavigation } from "react-router-dom";
import "./Home.css";

export const Home = () => {
  return (
    <div className="main-container">
      <div className="sideBar">
        <img
          src={require("../../images/burger_menu.png")}
          className="menuimage"
          alt="menu"
        />
        <img
          src={require("../../images/burger_menu.png")}
          className="homeimage"
          alt="home"
        />
      </div>
      <div className="side-conatiner">
        <div className="tabBar">
          <img
            src={require("../../images/logo1.png")}
            className="logoimage"
            alt="logo"
          />
          <div className="divboxcontainer">
            <div className="divbox">
              <img
                src={require("../../images/sync_icn.png")}
                alt="sync"
                className="syncimg"
              />
            </div>
            <div className="divbox">
              <img
                src={require("../../images/profile.png")}
                alt="profile"
                className="profileimg"
              />
            </div>
          </div>
        </div>
        <div className="viewContainer">fdsfsdfsdfs</div>
      </div>
    </div>
  );
};
